window.bookSummaryJSON = "<p><b>Number one best-selling erotic author Pepper North dares to go darker in the Leave Me Breathless Black Rose Collection.</b></p> <p>Do you want your fantasies to come true? </p> <p>When this simple question appears on her computer, Mia Daniels dares to answer \"yes\". One honest response sends the willowy brunette on a collision course with her every forbidden desire.</p> <p>Domineering and magnetic, Rafael Montalvo selects Mia to be his at first sight. Soon, she is ensnared in his shadowy world, unable to resist the new life that he controls completely. Rafael's darkness just might be everything Mia has ever needed and so much more. </p> <p><b>Trigger warning: </b>The stories in the Black Rose Collection are considered dark romance. Some aspects may be sensitive for some listeners.</p>"; 
